import './App.css'

function App() {
  return (
    <div class="main">
      <hr/>
      <div class="post">
        <span class="num">번호</span>
        <span class="title">제목</span>
        <span class="comments"> [0] </span>
        <span class="author">작성자</span>
        <span class="views">조회수</span>
      </div>
      <hr/>
    </div>
  );
}

export default App;
